        <div><strong>AU Sunrise Crimson Clover</strong></div>
        <p>
        AU Sunrise is an improved reseeding type crimson clover variety newly released from the USDA Plant Materials Center and Auburn University. It is more winter hardy than Dixie and heads a week earlier than AU Robin and up to three weeks earlier than Dixie. AU Sunrise's fast establishment and early blooming makes it an excellent choice for cover crop use.</p>
